import React, { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/steaminfo").then(
      res => res.json()
    ).then(
      data => {
        setData(data);
        console.log(data);
      }
    )
  }, [])

  return(
    <div>
      {(typeof data.steaminfo == 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.steaminfo
      )}
    </div>
  )
}

export default App;
